Implement logging funtionality that write logs to txt file.

BinBashLogger object needs to be constructed in each class.
If you want to write a log, just call the log methods

Example of usage:

private static BinBashLogger logger = new BinBashLogger(<className>.class.getName())

BinBashLogger.info("message");
BinBashLogger.warning("message");
